const addUser = (user) => {
    return {
        type: 'NEW_USER',
        payload: user
    }

}

const login = () => {
    return {
        type: 'LOGIN'
    }
}

const logout = () => {
    return {
        type: 'LOGOUT'
    }
}

const someErorr = (bool) => {
    return {
        type: 'ERROR',
        payload: bool
    }
}

const allUsers = (allUsers) => {
    return {
        type: 'ALL_USERS',
        payload: allUsers
    }
}

const posts = (posts) => {
    return {
        type: 'ALL_POSTS',
        payload: posts
    }
}
const addedPost = (id, newPostData) => {
    return {
        type: 'POST_ADD_TO_STATE',
        payload: id,
        data: newPostData
    }
}
export {
    addUser,
    logout,
    someErorr,
    allUsers,
    login,
    posts,
    addedPost
}
